// AddCourses adds the given related objects to the existing relationships
// of the image, optionally inserting them as new records.
// Appends related to o.R.Courses.
// Sets related.R.CourseImage appropriately.
func (o *Image) AddCourses(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*Course) error {
	var err error
	for _, rel := range related {
		if insert {
			queries.Assign(&rel.Image, o.ID)
			if err = rel.Insert(ctx, exec, boil.Infer()); err != nil {
				return errors.Wrap(err, "failed to insert into foreign table")
			}
		} else {
			updateQuery := fmt.Sprintf(
				"UPDATE `courses` SET %s WHERE %s",
				strmangle.SetParamNames("`", "`", 0, []string{"image"}),
				strmangle.WhereClause("`", "`", 0, coursePrimaryKeyColumns),
			)
			values := []interface{}{o.ID, rel.ID}

			if boil.IsDebug(ctx) {
				writer := boil.DebugWriterFrom(ctx)
				fmt.Fprintln(writer, updateQuery)
				fmt.Fprintln(writer, values)
			}
			if _, err = exec.ExecContext(ctx, updateQuery, values...); err != nil {
				return errors.Wrap(err, "failed to update foreign table")
			}

			queries.Assign(&rel.Image, o.ID)
		}
	}

	if o.R == nil {
		o.R = &imageR{
			Courses: related,
		}
	} else {
		o.R.Courses = append(o.R.Courses, related...)
	}

	for _, rel := range related {
		if rel.R == nil {
			rel.R = &courseR{
				CourseImage: o,
			}
		} else {
			rel.R.CourseImage = o
		}
	}
	return nil
}

// SetCourses removes all previously related items of the
// image replacing them completely with the passed
// in related items, optionally inserting them as new records.
// Sets o.R.CourseImage's Courses accordingly.
// Replaces o.R.Courses with related.
// Sets related.R.CourseImage's Courses accordingly.
func (o *Image) SetCourses(ctx context.Context, exec boil.ContextExecutor, insert bool, related ...*Course) error {
	query := "update `courses` set `image` = null where `image` = ?"
	values := []interface{}{o.ID}
	if boil.IsDebug(ctx) {
		writer := boil.DebugWriterFrom(ctx)
		fmt.Fprintln(writer, query)
		fmt.Fprintln(writer, values)
	}
	_, err := exec.ExecContext(ctx, query, values...)
	if err != nil {
		return errors.Wrap(err, "failed to remove relationships before set")
	}

	if o.R != nil {
		for _, rel := range o.R.Courses {
			queries.SetScanner(&rel.Image, nil)
			if rel.R == nil {
				continue
			}

			rel.R.CourseImage = nil
		}

		o.R.Courses = nil
	}
	return o.AddCourses(ctx, exec, insert, related...)
}

// RemoveCourses relationships from objects passed in.
// Removes related items from R.Courses (uses pointer comparison, removal does not keep order)
// Sets related.R.CourseImage.
func (o *Image) RemoveCourses(ctx context.Context, exec boil.ContextExecutor, related ...*Course) error {
	if len(related) == 0 {
		return nil
	}

	var err error
	for _, rel := range related {
		queries.SetScanner(&rel.Image, nil)
		if rel.R != nil {
			rel.R.CourseImage = nil
		}
		if _, err = rel.Update(ctx, exec, boil.Whitelist("image")); err != nil {
			return err
		}
	}
	if o.R == nil {
		return nil
	}

	for _, rel := range related {
		for i, ri := range o.R.Courses {
			if rel != ri {
				continue
			}

			ln := len(o.R.Courses)
			if ln > 1 && i < ln-1 {
				o.R.Courses[i] = o.R.Courses[ln-1]
			}
			o.R.Courses = o.R.Courses[:ln-1]
			break
		}
	}

	return nil
}

